                size *= .667;
                if (size < minCircleSize){break;}
            }
            progressBarCounter = progressBar.maxvalue * 0.25 / radiiList.length;
            for (rad=0; rad<radiiList.length; rad++){
                for (p=0; p<1000; p++){
