            anchor = leftDirection = rightDirection = [pos,5000];  
        } else {  
            anchor = leftDirection = rightDirection = [5000,pos];  
        }  
        pointTyoe = PointType.CORNER;  
    }  
    aPath.guides = true;  

}

// Common Tangents

// draws common tangents to the selected curved lines, if they are detected.


// test env: Adobe Illustrator CS3, CS6 (Windows)

