		var outputStr='';
		for(var i = 0; i < textstr.length; i++)
			{
                if (textstr[i] in lowercase)     outputStr = outputStr+String.fromCharCode(textstr.charCodeAt(i)-32)//a-z to A-ZOrderMethod
