var spacingInput = checkboxInputGroup2.add("edittext", undefined, "0");
statictext = checkboxInputGroup2.add("statictext", undefined, "mm");
spacingInput.characters = 3;

var grupoBotoes = checkboxInputGroup2.add ("group", undefined);
grupoBotoes.orientation = "row";
var fecharBotao = grupoBotoes.add ("button", undefined, "退出", {name:"ok"});   
fecharBotao.preferredSize = [40,25];

fecharBotao.onClick = function (){
        panel.close(); 
    }

// 移动选中的物体

function moveSelectedObjects(direction) {
  var selection = app.activeDocument.selection;
  var spacing = parseFloat(spacingInput.text);

  for (var i = 0; i < selection.length; i++) {
    var object = selection[i];
    var bounds = object.geometricBounds;
    var width = bounds[2] - bounds[0];
    var height = bounds[1] - bounds[3];
    
  if (object.typename === "GroupItem" && object.pathItems.length > 0 && object.pathItems[0].clipping) {
    var maskBounds = object.pathItems[0].geometricBounds;
    width = maskBounds[2] - maskBounds[0];
    height = maskBounds[1] - maskBounds[3];
  } 
  // 支持蒙版对象
  
    var moveX = 0;
    var moveY = 0;

   if (direction === "left") {
      moveX = -width - spacing*mm;
    }else if (direction === "upleft") {
      moveX = -width - spacing*mm;
      moveY = height + spacing*mm;
    } else if (direction === "upright") {
      moveX = width + spacing*mm;
      moveY = height + spacing*mm;
    } else if (direction === "right") {
      moveX = width + spacing*mm;
    } else if (direction === "up") {
      moveY = height + spacing*mm;
    } else if (direction === "lowerleft") {
      moveX = -width - spacing*mm;
      moveY = -height - spacing*mm;
    } else if (direction === "lowerright") {
      moveX = width + spacing*mm;
      moveY = -height - spacing*mm;
    }  else if (direction === "down") {
      moveY = -height - spacing*mm;
    }else if (direction === "insitu") {
      moveY = 0;
      moveX = 0;
    }



  if (copyCheckbox.value) {
      var duplicate = object.duplicate();
    if (mirrorCheckbox.value) {
    if (direction === "left") {
      duplicate.transform(verticalMatrix); 
    }else if (direction === "upleft") {
      duplicate.transform(verticalMatrix); 
      duplicate.transform(horizontalMatrix); 
    } else if (direction === "upright") {
      duplicate.transform(verticalMatrix); 
      duplicate.transform(horizontalMatrix); 
    } else if (direction === "right") {
      duplicate.transform(verticalMatrix); 
    } else if (direction === "insitu") {
      duplicate.transform(verticalMatrix); 
    } else if (direction === "up") {
      duplicate.transform(horizontalMatrix); 
    } else if (direction === "lowerleft") {
      duplicate.transform(verticalMatrix); 
      duplicate.transform(horizontalMatrix); 
    } else if (direction === "lowerright") {
      duplicate.transform(verticalMatrix); 
      duplicate.transform(horizontalMatrix); 
    } else if (direction === "down") {
      duplicate.transform(horizontalMatrix); 
    }
 }
      duplicate.left += moveX;
      duplicate.top += moveY;
}else{
 if (mirrorCheckbox.value) {
    if (direction === "left") {
      object.transform(verticalMatrix); 
    }else if (direction === "upleft") {
      object.transform(verticalMatrix); 
      object.transform(horizontalMatrix); 
    } else if (direction === "upright") {
      object.transform(verticalMatrix); 
      object.transform(horizontalMatrix); 
    } else if (direction === "right") {
      object.transform(verticalMatrix); 
    } else if (direction === "insitu") {
      object.transform(verticalMatrix); 
    } else if (direction === "up") {
      object.transform(horizontalMatrix); 
    } else if (direction === "lowerleft") {
      object.transform(verticalMatrix); 
      object.transform(horizontalMatrix); 
    } else if (direction === "lowerright") {
      object.transform(verticalMatrix); 
      object.transform(horizontalMatrix); 
    } else if (direction === "down") {
      object.transform(horizontalMatrix); 
    }
 }
      object.left += moveX;
      object.top += moveY;
    }
      app.redraw(); // 刷新界面
    if (maskCheckbox.value) {
      var mask = object.parent.mask;
      if (mask) {
        mask.left += moveX;
        mask.top += moveY;
      }
    }
  }
}
// 显示面板
panel.show();
